import styled from 'styled-components';

// Definir un componente styled para el video
const VideoContainer = styled.video`
  width: 100%;
  height: 500px;
  margin-bottom: 2%;
`;

const Video = () => {
  return (
    <>
      {/* Video de YouTube */}
      <Frame
        height='500'
        src='https://www.youtube.com/embed/jEU1lPe3bKg?si=QtC048c3lkrjMhXB'
        title='Consejo Nacional Forestal'
        frameborder='0'
        allow='accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture'
        allowfullscreen
      ></Frame>

      {/* Video local */}
      <VideoContainer controls>
        <source src="ruta/al/video.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </VideoContainer>
    </>
  );
}

// Definir el componente Frame
const Frame = styled.iframe`
  width: 100%;
  margin-bottom: 2%;
`;

export default Video;
